function Header() {
    return(
        <div id="header" className="row">
            <div id="logo" className="col-md-3"><div className="well">3<br/>#logo</div></div>
            <div id="header-content" className="col-md-9"><div className="well">9<br/>header-content</div></div>
            <div id="logo" className="col-md-3"><div className="well">3<br/>#logo</div></div>
            <div id="header-content" className="col-md-9"><div className="well">9<br/>header-content</div></div>
        </div>
    )

}
export default Header
